const _c0 = function () { return { standalone: true }; };
export class AddupdateEnquiryFormComponent extends ParentOptMgtComponent {
    constructor(fb, http, router, apiService, authService, utilService, translate, notifyService, validationService, dialogRef) {
        super(authService);
        this.fb = fb;
        this.http = http;
        this.router = router;
        this.apiService = apiService;
        this.authService = authService;
        this.utilService = utilService;
        this.translate = translate;
        this.notifyService = notifyService;
        this.validationService = validationService;
        this.dialogRef = dialogRef;
        this.readonly = "";
        this.showApprove = true;
        this.id = 0;
        this.siteCodeList = [];
        this.siteCodeListAll = [];
        this.unitCodeList = [];
        this.serviceCodeList = [];
        this.customerCode = '';
        this.custCodeControl = new FormControl('', Validators.required);
        this.branchCodeList = [];
        this.isDataLoading = false;
        this.listOfEnquiries = [];
        this.sequence = 1;
        this.editsequence = 0;
        this.enquiryNumber = '';
        this.serviceCode = '';
        this.serviceQuantity = 0;
        this.pricePerUnit = 0;
        this.unitQuantity = 0;
        this.estimatedPrice = 0;
        this.totalEstPrice = 0;
        this.statusEnquiry = "Open";
        this.serviceNameArb = '';
        this.serviceNameEng = '';
        this.custAddress = '';
        this.isActive = true;
        this.stusEnquiryHead = "Open";
        this.isOldEnquiryForm = false;
        this.isArabic = false;
        this.isAdednum = false;
        this.filteredCustCodes = this.custCodeControl.valueChanges.pipe(startWith(this.customerCode), debounceTime(utilService.autoDelay()), distinctUntilChanged(), switchMap((val) => {
            if (val.trim() !== '')
                this.isDataLoading = true;
            return this.filterCustCodes(val || '');
        }));
    }
    filterCustCodes(val) {
        return this.apiService.getall(`CustomerMaster/getSelectCustomerList?search=${val}`)
            .pipe(map(response => {
            const res = response;
            this.isDataLoading = false;
            return res;
        }));
    }
    loadBranchCodes() {
        this.apiService.getall('Branch/getSelectBranchCodeList').subscribe((res) => {
            console.log(res);
            // this.branchCodeList = [];
            this.apiService.getall('OpAuthorities/getOpAuthoritiesListByUserId').subscribe((res2) => {
                console.log(res2);
                if (res2.length == 0) {
                    this.utilService.ShowApiErrorMessage(this.translate.instant("You_Can_Not_Create_Enquiry"));
                    this.dialogRef.close(false);
                }
                else {
                    for (let i = 0; i < res2.length; i++) {
                        let branch = res.find(b => b.value == res2[i].branchCode);
                        if (branch != null && this.branchCodeList.findIndex(c => c.value == branch.branchCode) == -1) {
                            this.branchCodeList.push(branch);
                        }
                    }
                    console.log(this.branchCodeList);
                }
            });
        });
    }
    loadSiteCodes(custCode) {
        this.apiService.getall(`CustomerSite/getSelectSiteListByCustCode/${custCode}`).subscribe(res => {
            this.siteCodeList = res;
            this.siteCodeListAll = res;
            if (this.id > 0) {
                this.loadSiteListNotCovertedAsProject();
            }
        });
    }
    loadServiceCodes() {
        this.apiService.getall('Services/getSelectServiceList').subscribe(res => {
            this.serviceCodeList = res;
        });
    }
    loadUnitCodes(serviceCode) {
        this.apiService.getall('Units/getSelectUnitListByServiceCode/' + serviceCode).subscribe(res => {
            this.unitCodeList = res;
            console.log(res);
        });
    }
    ngOnInit() {
        this.isArabic = this.utilService.isArabic();
        this.setForm();
        if (this.enquiryHead != null)
            this.setEditForm();
        this.readonly = "readonly";
        this.loadBranchCodes();
    }
    setForm() {
        this.form = this.fb.group({
            //'': ['', Validators.required],
            /*   EnquiryFormHeader*/
            'sitecode': [''],
            'enquiryNumber': ['XXXXXXXXXX'],
            'customerCode': ['', Validators.required],
            'branchCode': ['', Validators.required],
            'dateOfEnquiry': ['', Validators.required],
            'estimateClosingDate': ['', Validators.required],
            'userName': [''],
            'totalEstPrice': [],
            'remarks': [''],
            'stusEnquiryHead': ["Open"],
            'isActive': [true],
            /* Auto*/
            'saleRep': [''],
            'custAddress': [''],
            'serviceNameArb': [''],
            'serviceNameEng': [''],
            'serviceCode': [''],
            'unitCode': [''],
            //EnquiryDetails
        });
        this.setToDefault();
    }
    submit() {
        let sd = new Date(this.form.controls['dateOfEnquiry'].value);
        let ed = new Date(this.form.controls['estimateClosingDate'].value);
        sd.setMinutes(sd.getMinutes() - sd.getTimezoneOffset());
        ed.setMinutes(ed.getMinutes() - ed.getTimezoneOffset());
        this.form.value['dateOfEnquiry'] = sd;
        this.form.value['estimateClosingDate'] = ed;
        if (this.form.valid && this.listOfEnquiries.length > 0) {
            if (this.id > 0)
                this.form.value['id'] = this.id;
            this.form.value['enquiriesList'] = this.listOfEnquiries;
            this.form.value['custAddress'] = this.custAddress;
            this.form.value['estimatedPrice'] = this.estimatedPrice;
            this.form.value['serviceNameArb'] = this.serviceNameArb;
            this.form.value['serviceNameEng'] = this.serviceNameEng;
            this.apiService.post('ServiceEnquiryForm', this.form.value)
                .subscribe(res => {
                this.utilService.OkMessage();
                this.dialogRef.close(true);
            }, error => {
                console.error(error);
                this.utilService.ShowApiErrorMessage(error);
            });
        }
        else
            this.utilService.FillUpFields();
    }
    setEditForm() {
